import {customerReduser, cushReduser} from './redusers';

import { legacy_createStore as createStore, combineReducers, applyMiddleware } from "redux";
const rootReduser = combineReducers({
    // cash:cushReduser,
    // customer:customerReduser,
})

export const store = createStore(rootReduser, composeWithDevTools(applyMiddleware(thun)));
